int Utils::ConvertUTF16LEToUTF16BE(const unsigned short* pSrc, const int nSrcLen, unsigned short* pOut, int maxChars)
{
	const unsigned short *begin = pSrc;
    const unsigned short *end   = pSrc + nSrcLen;
    int n = 0;
    for (; n < maxChars && begin + n < end; n++) {
        pOut[n] = ((*(begin + n) & 0x00ff) << 8 | (*(begin + n) & 0xff00) >> 8);
    }
	pOut[n] = 0;
	return n;
}
